    playbackData.comments = {"ev-0":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-0","timestamp":1599236366361,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-1","timestamp":1609790048705,"commentText":"A function is a named block of code that our program can jump to, execute that code, and then return to the point where it was called from. We can also have the function return a value when the flow of control comes back to the function call.<br><br>When a function returns a value we can think of it like a mathematical function. You supply some input, like an X value, and it uses that value to calculate and return a Y value. <br><br>We have been using functions already. The <font face=\"Courier\">print</font> function prints some text to the screen. The <font face=\"Courier\">len</font> function returns the length of a string or collection. I did not write these function, they come as part of the Python language. There are many useful built-in functions like this. One can also import even more helpful functions.<br><br>The syntax for creating your own functions looks like this:<br>- <font face=\"Courier\">def</font> means create a function<br>- <font face=\"Courier\">functionName</font> is a name of your choosing (be sure to choose a meaningful name that describes what your function is doing)<br>- the parentheses are where you can put in optional parameters (like plugging in an X value in a mathematical function)<br>- a colon is required at the end the function header<br>- the function body is defined by ‘tabbing in’ underneath the function header<br><br>Here is what that function would look like:<br><font face=\"Courier\">def functionName():<br>&nbsp;&nbsp;&nbsp; #code here</font>","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"","linesBelow":"","currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-58":[{"id":"commentId-1","displayCommentEvent":{"id":"ev-58","timestamp":1535939165878,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":58,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-57","lineNumber":2,"column":39,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609790084793,"commentText":"This is a function called <font face=\"Courier\">printName</font>. The function body is just a single print statement but functions can be much longer. All of the code inside of a function is tabbed in at least once.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"def printName(): \n\tprint(\"  ~~ Mark Mahoney was here ~~\")","startRow":0,"startColumn":0,"endRow":1,"endColumn":39}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/func.py","viewableBlogText":"def printName(): \n\tprint(\"  ~~ Mark Mahoney was here ~~\")","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-175":[{"id":"commentId-2","displayCommentEvent":{"id":"ev-175","timestamp":1535939165878,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":175,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-174","lineNumber":6,"column":46,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609790136257,"commentText":"Here is another function. If I run the program now there will be no output because I have not called (or invoked) either function. These functions exist to be 'called' by the part of the program that has the active flow of control.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"def neverCalled(): \n\tprint(\"You will not see this on the screen\") \n\tprint(\"because the function is never called\")","startRow":3,"startColumn":0,"endRow":5,"endColumn":46}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"3","linesBelow":"0","currentFilePath":"/func.py","viewableBlogText":"def printName(): \n\tprint(\"  ~~ Mark Mahoney was here ~~\") \n \ndef neverCalled(): \n\tprint(\"You will not see this on the screen\") \n\tprint(\"because the function is never called\")","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-265":[{"id":"commentId-3","displayCommentEvent":{"id":"ev-265","timestamp":1535939165878,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":265,"type":"INSERT","fileId":"fileId-0","character":"\n","previousNeighborId":"ev-264","lineNumber":10,"column":35,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609790165159,"commentText":"This code is outside of any function. The flow of control executes code that is outside of any function from the top of the file to the bottom. So, this code will be executed.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"print(\"About to call a function...\") \nprintName() \nprint(\"Whew, that was exciting!\") ","startRow":7,"startColumn":0,"endRow":9,"endColumn":34}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"7","linesBelow":"0","currentFilePath":"/func.py","viewableBlogText":"def printName(): \n\tprint(\"  ~~ Mark Mahoney was here ~~\") \n \ndef neverCalled(): \n\tprint(\"You will not see this on the screen\") \n\tprint(\"because the function is never called\") \n \nprint(\"About to call a function...\") \nprintName() \nprint(\"Whew, that was exciting!\") ","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-4","displayCommentEvent":{"id":"ev-265","timestamp":1535939165878,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":265,"type":"INSERT","fileId":"fileId-0","character":"\n","previousNeighborId":"ev-264","lineNumber":10,"column":35,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609790284332,"commentText":"This is a function call. Function calls include the name of a function and a set of parentheses.<div><br></div><div>When the Python interpreter sees something like this it causes the flow of control to jump to the function body and the flow of control will pick up from there.</div><div><br></div><div>The flow of control is sequential by default but may be changed by having an <font face=\"Courier\">if</font> statement, loop, or another function call.</div><div><br></div><div>When the end of the function body is reached the flow of control jumps back to where it was called.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"printName()","startRow":8,"startColumn":0,"endRow":8,"endColumn":11}],"imageURLs":["media/images/1609790281411-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"8","linesBelow":"1","currentFilePath":"/func.py","viewableBlogText":"def printName(): \n\tprint(\"  ~~ Mark Mahoney was here ~~\") \n \ndef neverCalled(): \n\tprint(\"You will not see this on the screen\") \n\tprint(\"because the function is never called\") \n \nprint(\"About to call a function...\") \nprintName() \nprint(\"Whew, that was exciting!\") ","commentTags":["image"],"questionCommentData":null,"commentTitle":""},{"id":"commentId-5","displayCommentEvent":{"id":"ev-265","timestamp":1535939165878,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":265,"type":"INSERT","fileId":"fileId-0","character":"\n","previousNeighborId":"ev-264","lineNumber":10,"column":35,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609790345634,"commentText":"Notice that these prints never get executed. This is because the <font face=\"Courier\">neverCalled</font> function is never called (it has a good name!).<div><br></div><div>It does not make much sense to have a function that is never called but I am doing it here to show when the code inside functions get executed.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"def neverCalled(): \n\tprint(\"You will not see this on the screen\") \n\tprint(\"because the function is never called\")","startRow":3,"startColumn":0,"endRow":5,"endColumn":46}],"imageURLs":["media/images/1609790319489-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"3","linesBelow":"4","currentFilePath":"/func.py","viewableBlogText":"def printName(): \n\tprint(\"  ~~ Mark Mahoney was here ~~\") \n \ndef neverCalled(): \n\tprint(\"You will not see this on the screen\") \n\tprint(\"because the function is never called\") \n \nprint(\"About to call a function...\") \nprintName() \nprint(\"Whew, that was exciting!\") ","commentTags":["image"],"questionCommentData":null,"commentTitle":""}]};
